// Get the Worksite Layer
var workSite = FeatureSetByName($map, "Worksites");
// Buffer the current location and intersect with the bus stops
var bufferedLocation = Buffer($feature, 500, "feet");
var candidateSites = Intersects(workSite, bufferedLocation);
// Calculate the distance between the bus stops and the current location
// Store the feature and distance as a dictionary and push it into an array
var featuresWithDistances = [];
for (var f in candidateSites) {
  Push(featuresWithDistances, {
    distance: Distance($feature, f, "feet"),
    feature: f
  });
}
// Sort the candidate worksites by distance using a custom function
function sortByDistance(a, b) {
  return a["distance"] - b["distance"];
}
var sorted = Sort(featuresWithDistances, sortByDistance);
// Get the worksite
var closestFeatureWithDistance = First(sorted);
// If there was worksite, return null
if (IsEmpty(closestFeatureWithDistance)) {
  return null;
}
// Return the worksite id attribute value
return closestFeatureWithDistance["feature"]["worksite_id"];
